          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"formatter":{"id":"1432"},"group":null,"major_label_policy":{"id":"1433"},"ticker":{"id":"1013"},"visible":false},"id":"1012","type":"LinearAxis"},{"attributes":{},"id":"1471","type":"YearsTicker"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"num_fds"}},"id":"1396","type":"Line"},{"attributes":{"dimensions":"width"},"id":"1058","type":"WheelZoomTool"},{"attributes":{"months":[0,6]},"id":"1470","type":"MonthsTicker"},{"attributes":{},"id":"1082","type":"LinearScale"},{"attributes":{},"id":"1449","type":"NoOverlap"},{"attributes":{"dimensions":"width"},"id":"1094","type":"WheelZoomTool"},{"attributes":{"source":{"id":"1150"}},"id":"1175","type":"CDSView"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1461","type":"AdaptiveTicker"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1462","type":"AdaptiveTicker"},{"attributes":{},"id":"1442","type":"AllLabels"},{"attributes":{"callback":null},"id":"1092","type":"TapTool"},{"attributes":{"days":[1,8,15,22]},"id":"1465","type":"DaysTicker"},{"attributes":{},"id":"1441","type":"BasicTickFormatter"},{"attributes":{},"id":"1448","type":"AllLabels"},{"attributes":{"base":1024,"mantissas":[1,2,4,8,16,32,64,128,256,512]},"id":"1178","type":"AdaptiveTicker"},{"attributes":{"below":[{"id":"1084"}],"center":[{"id":"1087"},{"id":"1091"}],"left":[{"id":"1088"}],"renderers":[{"id":"1106"}],"sizing_mode":"stretch_both","title":{"id":"1415"},"toolbar":{"id":"1097"},"x_range":{"id":"1076"},"x_scale":{"id":"1080"},"y_range":{"id":"1078"},"y_scale":{"id":"1082"}},"id":
